import { AxiosInstances } from '../../Util/AxiosInstances'


export const searchProduct = async (key) => {
    const URL = "/locations/v2/search"
    const data= {
        query: {},
        updateToken: ''
      }
    return AxiosInstances.post(URL,{key});
}
